  const[info, setInfo] = useState({})

  const getData = async () => {
    const response = await axios.get('https://api.weatherapi.com/v1/forecast.json?key=35360d18e86c4006a60111222212904&q=giza&days=1');
    const data = await response.data;
    console.log(data)
      setInfo(data)
  }
  useEffect(() => {
    getData()
  },[])
  return (
    <div >
      <Banner name ={info.location.name} temp_c={info.current.temp_c} icon ={info.current.condition.icon} text={info.current.condition.text} />
      <DayInfo infos={info.forecast.forecastday[0]} />
      {console.log(info)}
    </div>
  );
}
